\f0\fs28 \cf2 Above is the current background LED animation for the Trans-Ionospheric badge. It is \'93faux status\'94 in that it\'92s a simulation of powering up, receiving the channel list, attempting to authenticate and authorize, getting  channel assigned, and sending traffic through the payload. We use it to demonstrate what the badge might look like as a \'93real\'94 radio peripheral, and to teach basic concepts of system acquisition. In order to reflect real system status, we replace the Faux Status Conditions with real ones, transmitted from a Phase 4 Ground radio development board. For this stage, we selected the ESP32. }

