\f0\fs28 \cf2 What bluetooth mode? Connected mode? Or broadcast packets? Broadcast is reasonable for a modest number of bits of status. Connected would be superior for control (the badge controls the radio in the reverse link) or for anything that might want to be private. Broadcast would enable multiple clients. }

