\f0\fs28 \cf2 What is the visual library entry for each status? These are RGB LEDs arranged in a pattern on a wearable badge. The uplink has three, the downlink has three, and the payload has five. There is one LED for each of four labels on the bottom edge. These are Treble, Voice, Alto, and Bass. }
